import { FastField } from "formik";
import React, { useState } from "react";

export const SwitchCheckBox = ({ label, name }) => {
  const [changeRadio, setChangeRadio] = useState(false);
  return (
    <div className="form-check form-switch pt-4">
      <FastField id={name}  name={name} type="checkbox"  className="form-check-input pointer">
        {() => (
          <>
            <input
              id={name}
              type="checkbox"
              className="form-check-input pointer"
              value={name}
              // onChange={() => {
              //   console.log(name);
              //   console.log(label);
              // }}
            />
            <label className="form-check-label" htmlFor={name}>
              {label}
            </label>
          </>
        )}
      </FastField>
    </div>
  );
};

